import React from 'react';
import { Button, Jumbotron, Container, Form, Col, Row} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './WatchPage.css';

class PlaybackArea extends React.Component{
    constructor(props){
        super();
    }

    render(){
        return(
            <Container>
                <Image src="../public/maps/mirage.png" rounded></Image>
            </Container>
        );
    }
}

class Game extends React.Component{
    constructor(props){
        super();
    }

    render(){
        return(
            <Jumbotron>
                <PlaybackArea props={props.game}/>
            </Jumbotron>
        );
    }
}

function WatchPage(props){
    return(
        <Container>
            <Game props={props.game}/>
        </Container>
    )
}

export default WatchPage;
